import { Maverick } from "./MyReact.js";
/** @jsx.Maverick.createElement */
const inputEle = Maverick.createElement("input", {
  className: "input-bar",
  placeholder: "something",
});
const liele = Maverick.createElement("li", {}, "something");
const ulEle = Maverick.createElement("ul", { className: "somecrap" }, liele);

const divEle = Maverick.createElement(
  "div",
  {
    className: "nothing",
  },
  inputEle,
  ulEle
);

function test() {
  const [state, setState] = Maverick.useState(0);
  const counter = Maverick.createElement(
    "h1",
    {
      onclick: setState((c) => c + 1),
    },
    `${{ state }}`
  );
  return counter;
}

const element = divEle;
const count = test;
const container = document.getElementById("root");
Maverick.render(element, container);
Maverick.render(count, container);
